import {useState} from 'react';
import Button from '../../components/utils/button/button';
import {useParams} from 'react-router-dom';

export default function ConfirmPassword(){

    const [password, setPassword] = useState('');
    const [confirmPassword, setConfirm] = useState('');
    const {idUsuario} = useParams();
    
    async function handleSubmmit(e){
        e.preventDefault();
        
        try {

            if(password!=='' && confirmPassword!==''){
                console.log(password, confirmPassword);
            }
            
        } catch (error) {
            
        }
       
       
    }

    return (
        <div>
            <div><a href="/"><img src="https://i.imgur.com/tDvwyyA.png" className = {'logo'} title="Smart Palm"/></a></div>
            <br></br>
            <br></br>
            <br></br>
            <br></br>
            <br></br>
            <br></br>
            <form className={'form'}>
            <text>Forgot Password</text>
            <br></br>
            <label>
                <br></br>
                New Password:
                <input type="text" onChange={e => setPassword(e.target.value)} />
            </label>
            <br></br>
            <label>
                <br></br>
                Confirm Password:
                <input type="text" onChange={e => setConfirm(e.target.value)} />
            </label>
            <Button buttonSize='btn--large' onClick={handleSubmmit}>SUBMIT</Button>
          </form>
          
        </div>
    );
}
